INSERT INTO `kpi` VALUES (33,'บัญชีการเงิน-จำนวนครั้งที่หน่วยตรวจสอบให้แก้ไข(หน่วย:ครั้ง)','จำนวนครั้งที่หน่วยตรวจสอบให้แก้ไข(สำหรับประเมินพนักงานบัญชี)',198,'KPI001',NULL,NULL,1,NULL),(34,'บัญชีการเงิน-จำนวนครั้งที่ขาดสภาพคล่อง/กระทบงานอื่นๆ(หน่วย:ชั่วโมง)','จำนวนครั้งที่ขาดสภาพคล่อง/กระทบงานอื่นๆ(สำหรับประเมินพนักงานบัญชี)',198,'KPI002',NULL,NULL,1,NULL),(35,'บัญชีการเงิน-% ความพึงพอใจ(ดี)(หน่วย:ร้อยละ)','% ความพึงพอใจ(ดี)(สำหรับประเมินพนักงานบัญชี)',198,'KPI003',NULL,NULL,1,NULL),(36,'บัญชีการเงิน-จำนวนครั้งที่ปิดบัญชีไม่ทันกำหนด(หน่วย:ครั้ง)','จำนวนครั้งที่ปิดบัญชีไม่ทันกำหนด(สำหรับประเมินพนักงานบัญชี)',198,'KPI004',NULL,NULL,1,NULL),(42,'การตลาด-จำนวนข้อร้องเรียนจากลูกค้า(หน่วย:ครั้ง)','  ( ≤1 ครั้ง)  นับจำนวนข้อร้องเรียนจากลูกค้า  (ความถี่ ทุกเดือน)',198,'KPI005',NULL,NULL,1,NULL),(43,'การตลาด-อัตรายอดขายประจำงวดการประเมิน(หน่วย:ล้านบาท)',' อัตรายอดขายประจำงวดการประเมินเทียบกับปีที่แล้ว',198,'KPI006',NULL,NULL,1,NULL),(44,'การตลาด-ยอดสั่งซื้อของลูกค้าเฉลี่ยต่อเดือน(หน่วย:ร้อยละ)','ยอดสั่งซื้อของลูกค้าเฉลี่ยต่อเดือน (≥ 80%) ใบสั่งซื้อ (PO), ใบตอบรับการเสนอราคา (ความถี่ ทุกเดือน)',198,'KPI007',NULL,NULL,1,NULL),(45,'การตลาด-จำนวนลูกค้าที่ติดต่อเข้ามาเอง(หน่วย:ร้อยละ)',' จำนวนลูกค้าที่ติดต่อเข้ามาเอง (≥ 90% ของลูกค้าทั้งหมด) บันทึก (สมุด/แบบฟอร์มการรับเรื่อง) (ความถี่ ทุกเดือน)',198,'KPI008',NULL,NULL,1,NULL),(78,'ไอที-ผู้ปฎิบัติงานทางด้าน ICT ที่มีความรู้ความชำนาญเฉพาะทาง หรือผ่านการทดสอบมาตรฐานวิชาชีพ (หน่วย:ร้อยละ)','ผู้ปฎิบัติงานทางด้าน ICT ที่มีความรู้ความชำนาญเฉพาะทาง หรือผ่านการทดสอบมาตรฐานวิชาชีพ (หน่วย:ร้อยละ)',198,'KPI009',NULL,NULL,1,NULL),(766,'ปริมาณของเสียที่เกิดจากการผลิต','ลงลง 5% ของปีที่ผ่านมา',199,'P001',NULL,NULL,1,NULL),(79,'ไอที-จำนวนครั้งของการเกิด downtime ของระบบ ICT และระยะเวลาในการกู้คืน(หน่วย:ครั้ง)','จำนวนครั้งของการเกิด downtime ของระบบ ICT และระยะเวลาในการกู้คืน',198,'KPI010',NULL,NULL,1,NULL),(80,'ไอที-จำนวนครั้งของการถูกบุกรุก และระดับความปลอดภัยที่ยอมรับได้ (หน่วย:ครั้ง)','จำนวนครั้งของการถูกบุกรุก และระดับความปลอดภัยที่ยอมรับได้ (หน่วย:ครั้ง)',198,'KPI011',NULL,NULL,1,NULL),(81,'ไอที-จำนวนโครงการ/กิจกรรมที่จัดขึ้น เพื่อพัฒนาความรอบรู้ ICT ของผู้เรียนและผู้ปฏิบัติงาน(หน่วย:โครงการ)','จำนวนโครงการ/กิจกรรมที่จัดขึ้น เพื่อพัฒนาความรอบรู้ ICT (หน่วย:โครงการ)ของผู้เรียนและผู้ปฏิบัติงาน',198,'KPI012',NULL,NULL,1,NULL),(82,' บุคคล-อัตราการมาทำงานของพนักงาน  95% ต่อเดือน(หน่วย:คน)','จำนวนพนักงานที่มาทำงานต่อวัน อัตราการไม่มาทำงานต่อวัน เอกสารรายงานผลการดำเนินงานตามวัตถุประสงค์',198,'KPI013',NULL,NULL,1,NULL),(83,'บุคคล-อัตราการมาสายลดลง  50 %(หน่วย:ร้อยละ)','รายงานการมาสายของพนักงานจำแนกตามระดับ ตำแหน่งแผนก ',198,'KPI014',NULL,NULL,1,NULL),(84,'บุคคล-อัตราการหยุดงาน ไม่เกิน 3 % ต่อเดือน(หน่วย:ร้อยละ)','รายงานอัตราการหยุดงานแต่ละประเภท ',198,'KPI015',NULL,NULL,1,NULL),(85,'บุคคล-กิจกรรมเสริมสร้างแรงงานสัมพันธ์ที่ดี(หน่วย:ครั้ง)','กิจกรรมเสริมสร้างแรงงานสัมพันธ์ที่ดี เน้นการทำงานเป็นทีม และมุ่งความสนใจส่วนบุคคล',198,'KPI016',NULL,NULL,1,NULL),(86,'จัดซื้อ-การควบคุมราคา/ต้นทุนของวัตถุดิบ(หน่วย:ร้อยละ)','จัดซื้อ-การควบคุมราคา/ต้นทุนของวัตถุดิบ(หน่วย:ร้อยละ)',198,'KPI017',NULL,NULL,1,NULL),(87,'จัดซื้อ-การลดราคา/ต้นทุนของวัตถุดิบ(หน่วย:ล้านบาท)','การลดราคา/ต้นทุนของวัตถุดิบ',198,'KPI018',NULL,NULL,1,NULL),(88,'จัดซื้อ-การติดตามการขอเสนอซื้อ(หน่วย:ครั้ง)','การติดตามการขอเสนอซื้อ(หน่วย:ครั้ง)',198,'KPI019',NULL,NULL,1,NULL),(89,'จัดซื้อ-คุณภาพการบริหารงานจัดซื้อ(หน่วย:ร้อยละ)','คุณภาพการบริหารงานจัดซื้อ(หน่วย:ร้อยละ)',198,'KPI020',NULL,NULL,1,NULL),(90,'โลจิสติกส์-ประสิทธิภาพในการดําเนินพิธีการศลุกากรที่ชายแดนของหน่วยงานที่เกี่ยวข้อง(หน่วย:ร้อยละ)','ประสิทธิภาพในการดําเนินพิธีการศลุกากรที่ชายแดนของหน่วยงานที่เกี่ยวข้อง(หน่วย:ร้อยละ)',198,'KPI021',NULL,NULL,1,NULL),(91,'โลจิสติกส์-คุณภาพของสาธารณูปโภคพื้นฐานของการขนส่งและระบบสารสนเทศสําหรับโลจิสตกิส(หน่วย:ร้อยละ)','คุณภาพของสาธารณูปโภคพื้นฐานของการขนส่งและระบบสารสนเทศสําหรับโลจิสตกิส',198,'KPI022',NULL,NULL,1,NULL),(92,'โลจิสติกส์-ความสะดวกในการนําเข้าหรือส่งออกสินค้าระหว่างประเทศ(หน่วย:ร้อยละ)','ความสะดวกในการนําเข้าหรือส่งออกสินค้าระหว่างประเทศ ',198,'KPI023',NULL,NULL,1,NULL),(93,'โลจิสติกส์-ความสามารถของอุตสาหกรรมโลจิสติกส์ในประเทศ(หน่วย:ร้อยละ) ','ความสามารถของอุตสาหกรรมโลจิสติกส์ในประเทศ ',198,'KPI024',NULL,NULL,1,NULL),(767,'ผลผลิต(productivity)','เพิ่มขึ้น 5% ของปีที่ผ่านมา',199,'P002',242,NULL,1,NULL),(768,' จํานวนครั้งที่ผลิตไม่ทันตามแผน','น้อยกว่า 5% ของจํานวนครั้งที่ผลิตทั้งหมด',199,'P003',242,NULL,1,NULL),(769,'ต้นทุนการผลิต','ลดลง 3% เมื่อเทียบกับปีที่ผ่านมา',199,'P004',242,NULL,1,NULL),(770,'การ Rework งานเสีย','น้อยกว่า 3% ของยอดการ ผลิตทั้งหมด',199,'P005',242,NULL,1,NULL),(771,'จํานวนสิ่งที่ไเป็นไปตามข้อกําหนด','ไม่เกิน 3% ของจํานวนที่ผลิต',199,'QC001',247,NULL,1,NULL),(772,'แก้ไขสาเหตุที่ทําเกิดสิ่งที่ไม่เป็นไม่ตามข้อกําหนด','ได้อย่างน้อย 5 สาเหตุต่อปี',199,'QC002',247,NULL,1,NULL),(773,'ความผิดพลาดที่พบจากการ Re-check','ผลการตรวจซ้ําต้องมีผล ความผิดพลาดเป็น ศูนย์',199,'QC003',247,NULL,1,NULL),(774,'จํานวน customer complaint ที่เกิดจากสินค้าตก Spec. ลดลงจากปีที่ผ่านมา','ลดลง 50% เมื่อเทียบกับปีที่ผ่านมา',199,'QC004',247,NULL,1,NULL),(775,'ฝีมือในการต่อรองราคา สามารถประหยัดเงินให้องค์กรได้','ประหยัดได้ 10% โดยที่ คุณภาพเท่าเดิมรวดเร็ว, มาตรฐานเหมือนเดิมหรือดีขึ้น',199,'PO001',241,NULL,1,NULL),(776,'สามารถสั่งซื้อวัตถุดิบได้ตรง ตาม Spec. ที่แต่ละฝ่ายต้องการ','มากกว่า 95% ของจํานวน รายการวัตถุดิบที่สั่งซื้อทั้งหมด',199,'PO002',241,NULL,1,NULL),(777,'เพิ่มจํานวน vendor เกรด A ให้ได้','70% ของ vendor ทั้งหมด',199,'PO003',241,NULL,1,NULL),(778,'กรณีเร่งด่วนจัดซื้อได้ทันตามกําหนดเวลาที่ตกลงกับ ผู้ต้องการสั่งซื้อ','90% ของความต้องการ สั่งซื้อทั้งหมด',199,'PO004',241,NULL,1,NULL),(779,'ความถูกต้องของบัญชีสินค้าคงคลัง','ถูกต้อง 100%',199,'WH001',244,NULL,1,NULL),(780,'จํานวนรายการวัตถุดิบที่มียอดตรงกับ Stock card','ไม่น้อยกว่า 98% ของรายการวัตถุดิบทั้งหมด',199,'WH002',244,NULL,1,NULL),(781,'ความสูญเสียของสินค้าเนื่องมาจากการจัดเก็บสินค้าในคลัง','สูญเสีย 0%',199,'WH003',244,NULL,1,NULL),(782,'การเก็บรักษาวัตถุดิบหลัก ให้มีปริมาณเหมาะสมตาม Min-Max ที่ตั้งไว้','รายการวัตถุดิบหลักทั้งหมดไม่น้อยกว่า 95% ของ',199,'